import React from "react";
import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker
} from "react-google-maps";

const MapContainer = withScriptjs(
  withGoogleMap(props => (
    <GoogleMap
      defaultZoom={15}
      defaultCenter={{ lat: 43.292576, lng: -4.691825 }}
    >
      {props.isMarkerShown && (
        <Marker position={{ lat: 43.292576, lng: -4.691825 }} />
      )}
    </GoogleMap>
  ))
);
<MapContainer
  googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyCuURQLKaUsOXYZWDi0ZXyKxCe0Hou48bU&=3.exp&libraries=geometry,drawing,places"
  loadingElement={<div style={{ height: `100%` }} />}
  containerElement={<div style={{ height: `400px` }} />}
  mapElement={<div style={{ height: `100%` }} />}
/>;

export default MapContainer;
